import { BrowserRouter, Routes, Route, createBrowserRouter,
  RouterProvider, } from 'react-router-dom';

// components
import Home from './pages/Home';

const router = createBrowserRouter([
  {
    path: '/',
    element: <Home />
  },
])

function App() {
  return (
    <div className="App">
      <RouterProvider router={router}>
        <div className="pages">
          <Routes>
            <Route 

            />
          </Routes>
        </div>
      </RouterProvider>
    </div>
  );
}

export default App;
